import React, {useState} from 'react'
import './MeetingTime.css'

//startTime used for styling (not actually needed since timer keeps going forever)
const MeetingTime = () => {
    const [isVisible, setVisible] = useState<boolean>(true);
    const changeVisible = () => {
        setVisible(false);
    }
    return (
        <div className="popup" style = {{display: !isVisible? 'none':''}}> Meeting Length:
        <button className = "xOut" onClick = {changeVisible}>x</button>
        </div>
    )
}


export default MeetingTime;
